      out.write("    function getCookie(cookie_name) {\r\n");
      out.write("        var isCookie = false;\r\n");
      out.write("        var start, end;\r\n");
      out.write("        var i = 0;\r\n");
      out.write("\r\n");
      out.write("        while(i <= document.cookie.length) {\r\n");
      out.write("            start = i;\r\n");
      out.write("            end = start + cookie_name.length;\r\n");
      out.write("            if(document.cookie.substring(start, end) == cookie_name) {\r\n");
      out.write("                isCookie = true;\r\n");
      out.write("                break;\r\n");
      out.write("            }\r\n");
      out.write("            i++;\r\n");
      out.write("        }\r\n");
      out.write("\r\n");
      out.write("        if(isCookie) {\r\n");
      out.write("            start = end + 1;\r\n");
      out.write("            end = document.cookie.indexOf(\";\", start);\r\n");
      out.write("            if(end < start)\r\n");
      out.write("                end = document.cookie.length;\r\n");
      out.write("            return document.cookie.substring(start, end);\r\n");
      out.write("        }\r\n");
      out.write("\r\n");
      out.write("        return \"\";\r\n");
      out.write("    }\r\n");
      out.write("\r\n");
      out.write("    function setCookie( name, value, expiredays ){\r\n");
      out.write("        var todayDate = new Date();\r\n");
